info:
  contact: {email: frikky@shuffler.io, name: '@frikkylikeme', url: 'https://twitter.com/frikkylikeme'}
  description: Automated generation of Phishlabs Phishlabs
  title: Phishlabs Phishlabs
  version: 1.0.0
  x-logo: data:image/png;base64,
openapi: 3.0.2
paths:
  tmp0:
    post:
      description: Return collection cases filtered by inputs.
      parameters:
      - description: CSV string of case status (no spaces)
        example: New,Closed,Rejected
        in: query
        name: Case Status
        required: false
        schema: {type: string}
      - description: CSV string of case types (no spaces)
        example: Job Scam,Phishing,419 Scam
        in: query
        name: Case Type
        required: false
        schema: {type: string}
      - description: Max number of records to return
        example: '13'
        in: body
        name: Max Records
        required: false
        schema: {type: string}
      - description: Paginate results used in conjunction with maxRecords
        example: '13'
        in: body
        name: Offset
        required: false
        schema: {type: string}
      - description: Generic Number
        example: caseOpen
        in: query
        name: Date Field
        required: false
        schema: {type: string}
      - description: Date query beginning date
        example: '2019-07-09T10:00:00Z'
        in: query
        name: Begin Date
        required: false
        schema: {type: string}
      - description: Date query beginning date
        example: '2019-07-09T10:00:00Z'
        in: query
        name: End Date
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: Phishlabs All Cases
  tmp1:
    post:
      description: Attach file to case
      parameters:
      - description: ID of the case being modified
        example: 068abef8-a32f-11e9-af13-0a8e0de89b4e
        in: query
        name: Case ID
        required: true
        schema: {type: string}
      - description: Type of file being attached
        example: image
        in: query
        name: Mime  Type
        required: true
        schema: {type: string}
      - description: Base 64 encoded file data
        example: iVBORw0K...8PDw9PT0
        in: query
        name: File Data
        required: true
        schema: {type: string}
      - description: Name of the file being attached
        example: testImage
        in: query
        name: File Name
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: Phishlabs Attach File
  tmp10:
    post:
      description: Return collection of open cases.
      parameters: []
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp10'}
          description: Successful request
      summary: Phishlabs Open Cases
  tmp11:
    post:
      description: Provides visibility to URL threats impacting your organization.
      parameters:
      - description: Beginning date range of threatfeed
        example: '2019-07-09T10:00:00Z'
        in: query
        name: Start Date
        required: true
        schema: {type: string}
      - description: Ending date range of threatfeed
        example: '2019-07-09T11:00:00Z'
        in: query
        name: Start Date
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp11'}
          description: Successful request
      summary: Phishlabs Threatfeed All
  tmp12:
    post:
      description: Provides visibility to URL threats impacting our entire client
        base.
      parameters:
      - description: Beginning date range of threatfeed
        example: '2019-07-09T10:00:00Z'
        in: query
        name: Start Date
        required: true
        schema: {type: string}
      - description: Ending date range of threatfeed
        example: '2019-07-09T11:00:00Z'
        in: query
        name: Start Date
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp12'}
          description: Successful request
      summary: Phishlabs Threatfeed Lite
  tmp2:
    post:
      description: Return collection of closed cases.
      parameters: []
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp2'}
          description: Successful request
      summary: Phishlabs Closed Cases
  tmp3:
    post:
      description: Return collection cases.
      parameters: []
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp3'}
          description: Successful request
      summary: Phishlabs Collection Cases
  tmp4:
    post:
      description: Create a new case
      parameters:
      - description: Brand of the case being created
        example: Generic Vendor
        in: query
        name: Brand
        required: true
        schema: {type: string}
      - description: Type of case being created
        example: Phishing
        in: query
        name: Case Type
        required: true
        schema: {type: string}
      - description: Description of the case being created
        example: This is an example case description
        in: query
        name: Description
        required: true
        schema: {type: string}
      - description: Title of the case being created
        example: New Case
        in: query
        name: Title
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp4'}
          description: Successful request
      summary: Phishlabs Create Case
  tmp5:
    post:
      description: Returns list of incidents and indicators within the feed.
      parameters:
      - description: Pull the data updated within this duration of time from now (default
          is 1h).
        example: 1h
        in: query
        name: Since
        required: false
        schema: {type: string}
      - description: Limit to number of incidents to return (default is 5).
        example: '5'
        in: body
        name: Limit
        required: false
        schema: {type: string}
      - description: Filter data by indicator type.
        example: URL
        in: query
        name: Indicator
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp5'}
          description: Successful request
      summary: Phishlabs Feed
  tmp6:
    post:
      description: Return collection of configured brands.
      parameters: []
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp6'}
          description: Successful request
      summary: Phishlabs Get Brands
  tmp7:
    post:
      description: Return collection available case types.
      parameters: []
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp7'}
          description: Successful request
      summary: Phishlabs Get Case Types
  tmp8:
    post:
      description: Returns global list of indicators, filtering client specific data.
      parameters:
      - description: Pull the data updated within this duration of time from now (default
          is 1h).
        example: 1h
        in: query
        name: Since
        required: false
        schema: {type: string}
      - description: Limit to number of incidents to return (default is 5).
        example: '5'
        in: body
        name: Limit
        required: false
        schema: {type: string}
      - description: Filter data by indicator type (URL, E-mail, etc).
        example: URL
        in: query
        name: Indicator
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp8'}
          description: Successful request
      summary: Phishlabs Global Feed
  tmp9:
    post:
      description: Add a note to the case from the client.
      parameters:
      - description: ID of the case being modified
        example: 068abef8-a32f-11e9-af13-0a8e0de89b4e
        in: query
        name: Case ID
        required: true
        schema: {type: string}
      - description: Comment being added to the case
        example: This is a sample comment
        in: query
        name: Note
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp9'}
          description: Successful request
      summary: Phishlabs Make Inquiry
tags:
- {name: Investigation}
